import React,{ useState } from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return(
        <>
            <nav className = 'Navbar'>
                <div className = 'Navbar-container'>
                    <Link to = '/' className = 'navbar-logo'>
                    WEBRE <i className = "fab fa-pagelines"/>
                    </Link>
                </div>
            </nav>
        </>
    )
}

export default Navbar;
